const initialState = {
  searchId: '',
  data: {},
};

export const dataReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'GET_SEARCH_ID': 
    console.log('got: ')
      return {...state, searchId: action.payload.searchId};
    case 'GET_TICKETS_DATA':
      return state.data;
    default:
      return state;
  }
}
